    data: |
      SELECT ALL + 6 - col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - ( - 46 ) * ( 85 + - col2 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q12512.out
    data: |
      -45
      -61
      -71
